INSERT INTO `pages` (`pageId`, `userId`, `parentId`, `role`, `pageName`, `pageUrl`, `visibility`, `createdDate`, `publishDate`, `modifiedDate`, `archivedDate`, `pageOrder`, `pageType`, `pageText`, `keyWords`, `showSlider`, `showInHomeWidget`) VALUES
(1, 1, 0, 'guest', 'Home', 'home', 'public', 2012, 0, 1381244039, 0, 1, 'home', '<h4>\r\n	About St. Elias Maronite Church</h4>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	St. Elias Maronite Church is located in Birmingham, Alabama. The church belongs to the Maronite Rite, which evolved from the Antiochene Tradition of Catholicism. The patron saint of our church is St. Elias (or Elijah, the Old-Testament prophet). St. Elias is depicted in the stained glass window behind our altar.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	The &quot;MARONITE RITE&quot; takes its name from a holy hermit called MARON, who lived in the 4th and 5th centuries near Antioch, in Northern Syria. He was a staunch defender of the Catholic faith. His disciples followed in his footsteps. It has been said that their history &quot;is the story of a people who were continually willing to shed their blood and sacrifice their lives and possessions for religious convictions and human liberties.&quot;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	The Maronite Church became a formal entity with the institution of the Maronite Patriarchate of Antioch and the Whole East, in the 7th century. The first Patriarch was St. John Maron, chosen in 685 A. D. The residence of the Maronite Patriarch is now in Lebanon.</p>\r\n', ' Testing, Extra,Keywords', 1, 0),
(15, 6, 0, 'guest', 'Festival', 'festival', 'public', 2012, NULL, 1396489546, NULL, 2, 'festival', '<p style="text-align: center;">\r\n	<span style="font-family: &quot;comic sans ms&quot;, cursive;"><span style="font-size: 36px;"><b><font color="#ee3125"><font color="#ee3125"><font color="#ee3125">16</font>th&nbsp;<font color="#ee3125">Annual Lebanese Food &amp; Cultural Festival</font></font></font></b></span></span></p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	<span style="font-family: comic sans ms,cursive;"><span style="font-size: 36px;"><b><font color="#ee3125"><font color="#ee3125"><font color="#ee3125"><img alt="" src="/modules/media/images/Default/LebaneseFoodFestivalLogo-FINAL-01.jpg" style="width: 400px; height: 390px;" /></font></font></font></b></span></span></p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	<span style="font-size: 28px;"><span style="font-family: comic sans ms,cursive;"><b><font color="#231f20"><font color="#231f20"><font color="#231f20">Friday, April 25th </font></font></font><font color="#231f20"><font color="#231f20"><font color="#231f20">and Saturday, April 26</font></font></font><font color="#231f20"><font color="#231f20"><font color="#231f20">th, 2014</font></font></font></b></span></span></p>\r\n<p style="text-align: center;">\r\n	<span style="font-family: comic sans ms,cursive;"><span style="font-size: 28px;"><b><font color="#231f20"><font color="#231f20"><font color="#231f20">10:00 am &ndash; 9:00 pm &ndash; Free Admission</font></font></font></b></span></span></p>\r\n<p style="text-align: center;">\r\n	<span style="font-family: comic sans ms,cursive;"><span style="font-size: 28px;"><b><font color="#231f20"><font color="#231f20"><font color="#231f20">Credit Cards Accepted</font></font></font></b></span></span></p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	<span style="font-family: comic sans ms,cursive;"><span style="font-size: 24px;"><span style="color: rgb(0, 100, 0);">The Lebanese Festival was recently chosen as one of the top 50 things you simply must do in&nbsp;Birmingham by Buzzfeed. &nbsp;So come to the Festival this year and check it off the list!</span></span></span></p>\r\n<p style="text-align: center;">\r\n	&nbsp;</p>\r\n<p style="text-align: center;">\r\n	<span style="font-family: comic sans ms,cursive;"><span style="font-size: 24px;"><span style="color: rgb(0, 100, 0);">Admission to the Festival&nbsp;entertainment and tour events is free and open to the public, and traditional Lebanese food will be&nbsp;available throughout both days for sale. Please&nbsp;click on the downloads tab&nbsp;above for a flyer and brochure with the complete listing of food and activities.&nbsp;</span></span></span></p>\r\n', '', 0, 0),
(83, 8, 0, 'guest', 'History', 'history', 'public', 1358189433, NULL, 1395678363, NULL, 3, 'home', '<p>\r\n	St. Elias Catholic Church is located in Birmingham, Alabama. The church belongs to the Maronite Rite, which evolved from the Antiochene Tradition of Catholicism. The patron saint of our church is St. Elias (or Elijah, the Old-Testament prophet). The picture above, left, depicts Elijah as he was putting to death the prophets of Baal as described in 1 Kings 18. The picture above, right, depicts Elias as the &quot;prophet of Mt. Carmel&quot; with scroll, fiery sword and mantle. The two views together present St. Elias as described in 1 Kings 19:14 &quot;I have been most zealous for the Lord, the God of Hosts.&quot;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p class="history">\r\n	<b>1910:</b> St. Elias Parish established. Building between 20th and 21st Streets and 6th Ave. South purchased and converted to a Catholic Church. First baptism on Jan. 20. Rev. Mobaarek Bellama, first pastor.</p>\r\n<p class="history">\r\n	<b>1911: </b> First Wedding, October 4 between Ayoub Wakeol and Deeby Assy.</p>\r\n<p class="history">\r\n	<b>1914: </b> Church dedication on Feb. 14 in honor of St. Elias</p>\r\n<p class="history">\r\n	<b>1917: </b> Rev. Joseph Koury named second pastor of St. Elias.</p>\r\n<p class="history">\r\n	<b>1920: </b> Rev. George Aziz named third pastor.</p>\r\n<p class="history">\r\n	<b>1939: </b> St. Elias closed temporarily.</p>\r\n<p class="history">\r\n	<b>1940: </b> St. Elias re-opened; Rev. Joseph Abi-Chedid becomes 10th pastor.</p>\r\n<p class="history">\r\n	<b>1945: </b> Land purchased at 8th Street and 9th Street South for new church.</p>\r\n<p class="history">\r\n	<b>1950: </b> First Divine Liturgy in new church --midnight, Christmas Eve</p>\r\n<p class="history">\r\n	First Baptism in new church -- December 31</p>\r\n<p class="history">\r\n	<b>1951: </b> First Wedding in new church -- March 25</p>\r\n<p class="history">\r\n	First Holy Communion in new church -- May 27</p>\r\n<p class="history">\r\n	<b>1959: </b> Church Hall built</p>\r\n<p class="history">\r\n	<b>1960: </b> Church Dedication and Golden Jubilee; Father Abi-Chedid elevated to Chor-Bishop</p>\r\n<p class="history">\r\n	<b>1962: </b> Parish Rectory built</p>\r\n<p class="history">\r\n	<b>1969: </b> Four Schoolrooms built; Chor-Bishop Abi-Chedid retires</p>\r\n<p class="history">\r\n	<b>1972: </b> St. Elias hosts Ninth Annual NAM Convention in Birmingham</p>\r\n<p class="history">\r\n	<b>1985: </b> Diamond Jubilee Year; Rev. Richard Saad appointed 15th pastor.</p>\r\n<p class="history">\r\n	<b>1988: </b> July 5-8, Nesrallah Peter Sfeir, Maronite Patriarch visits St. Elias.</p>\r\n<p class="history">\r\n	<b>1991: </b> Rev. Richard Saad named Monsignor (Chaplain to the Pope)</p>\r\n<p class="history">\r\n	<b>1993: </b> St. Elias hosts 30th Annual NAM Convention in Birmingham</p>\r\n<p class="history">\r\n	<b>1996: </b> Completed Multipurpose Building/Schoolroom addition to Parish Hall.</p>\r\n<p class="history">\r\n	<b>1999: </b> First Lebanese Food and Cultural Festival held</p>\r\n<p class="history">\r\n	<b>2000: </b> St. Elias celebrates 90th anniversary of its founding and 50th year at present location; 2nd annual Food and Cultural Festival held.</p>\r\n<p class="history">\r\n	<strong>2004:</strong> Monsignor Richard is ordained to Chorbishop.</p>\r\n<p class="history">\r\n	<strong>2007:</strong> Samuel Wehby is ordained to Deacon on Sept. 21.</p>\r\n<p class="history">\r\n	<strong>2008:</strong> 10th Annual Lebanese Food and Cultural Festival is held on April 11-12.</p>\r\n<p class="history">\r\n	<strong>2010</strong><strong>:</strong> 100th Anniversary of parish founding is celebrated; St. Elias hosts the 47th Annual Maronite Convention from July 7-10.</p>\r\n<p class="history">\r\n	<strong>2013:&nbsp;</strong> Kitchen renovation and expansion is completed. 15th Annual Food and Cultural Festival is held with the addition of a 5K run benefitting the SUKI Foundation.&nbsp;</p>\r\n<p class="history">\r\n	<strong>2014 &nbsp;</strong>Chorbishop Richard D. Saad is named Vicar General of the Eparchy of Our Lady of Lebanon by Eparchy&#39;s third bishop, Bishop A. Elias Zaidan. &nbsp;Bishop Zaidan makes his first visit to St. Elias March 28-30. Subdeacons Mark Ferris and James Wehby were ordained. New kitchen and Deacon Joseph Stephens Memorial were blessed. &nbsp;</p>\r\n', '', 0, 0),
(88, 1, 0, 'guest', 'Contact Us', 'contact-us', 'public', 1359055762, NULL, NULL, NULL, 4, 'contact', '<p>\r\n	Default text for the contact us page.</p>\r\n', '', 0, 0),
(93, 6, 15, 'guest', 'Delivery', 'delivery', 'public', 1362414492, NULL, 1396492496, NULL, 15, 'ordering', '<p>\r\n	You may place a delivery order beginning Monday, April 21 for the downtown or Southside areas of Birmingham for orders $75.00 dollars and up.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 0, 0),
(95, 6, 15, 'guest', 'Downloads', 'downloads', 'public', 1362414832, NULL, 1396489641, NULL, 17, 'festival', '<p>\r\n	For a festival flyer and menu, please <a href="/modules/media/images/Default/LebaneseFestivalFlyer.pdf">click here</a>.&nbsp;</p>\r\n<p>\r\n	For a festival brochure, please <a href="/modules/media/images/Default/LebaneseFestivalBrochure.pdf">click here</a>.</p>\r\n<p>\r\n	For a press release of the Festival, please <a href="/modules/media/images/Default/BHM-%232590233-v1-2014_Festival_News_Release.pdf">click here</a>.</p>\r\n<p>\r\n	For access to our Facebook Page for St. Elias Food and Cultural Festival, please <a href="http://www.facebook.com/pages/St-Elias-Food-and-Cultural-Festival/121961474655222">click here</a>.</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 0, 0),
(96, 7, 15, 'guest', 'Directions', 'directions', 'public', 1363122031, NULL, 1363973076, NULL, 14, 'festival', '<h4>\r\n	Directions</h4>\r\n<h6>\r\n	Coming from South via Interstate 65</h6>\r\n<p>\r\n	Take Greensprings Ave. exit (#258) and proceed right to first stoplight. Turn left onto Greensprings Highway. Follow around to 2nd stoplight. Turn right onto 8th St. South. St. Elias will be on the right as you go under the I65 overpass.</p>\r\n<h6>\r\n	Coming from North via Interstate 65</h6>\r\n<p>\r\n	Take 6th Avenue South exit (#259A) and proceed right to first stoplight. Turn left onto 8th St. South. Proceed past 1 stoplight and under I65 overpass. St. Elias will be on the right.</p>\r\n<h6>\r\n	NEW EXPANDED PARKING</h6>\r\n<p>\r\n	We will have two offsite parking lots available for use Friday evening and all day and night Saturday. From UAB remote parking lot 1 - located at 608 8th Street South directly across University Boulevard next to the car dealership and from UAB parking lot 15R on 10th Avenue South next to the Epic School parking lot.</p>\r\n<p>\r\n	<img alt="" src="/modules/pages/images/festival_map.jpg" style="width: 463px; height: 232px;" /></p>\r\n<p>\r\n	<strong>Click the purple pin below to get driving directions</strong>.</p>\r\n<p>\r\n	</p>\r\n', '', 0, 0),
(99, 6, 15, 'guest', '5k Run', '5k-run', 'public', 1363970275, NULL, 1394412516, NULL, 14, 'festival', '<p>\r\n	For information about our Second Annual St. Elias Cedar 5K and Cedar Shake Fun Run on Saturday, April 26 (i.e., Location, Route, Registration, Sponsorship, etc.) please<a href="http://register.dg-racing.net/search/event.aspx?id=19464"> </a><a href="http://www.cedarrun5k.com">Click Here</a>.<br />\r\n	<br />\r\n	For access to our Facebook Page for our 5K Run please <a href="http://www.facebook.com/#%21/pages/The-St-Elias-Cedar-Run-5K/343307039102439">Click Here</a>.</p>\r\n', '', 0, 0),
(100, 1, 1, 'guest', 'Schedule', 'schedule', 'public', 1380642780, NULL, 1395082259, NULL, 15, 'page', '<p>\r\n	Saturday 5:00 pm</p>\r\n<p>\r\n	Sunday 8:00 am and 10:30 am.</p>\r\n<p>\r\n	Daily 8:00 am Holy Days 7:00 PM vigil and 8:00 AM.</p>\r\n<p>\r\n	Confessions: Saturday 4:00 pm or anytime upon request.</p>\r\n', '', 0, 0),
(101, 1, 1, 'guest', 'Our Leadership', 'our-leadership', 'public', 1380643022, NULL, NULL, NULL, 16, 'page', '<p>Chorbishop Richard D. Saad Pastor</p>\n\n<p>Rev. Mr. Samuel J. Wehby Deacon</p>', '', 0, 0),
(102, 1, 1, 'guest', 'Calendar', 'calendar', 'public', 1380662286, NULL, 1384202644, NULL, 17, 'calendar', '<p>\r\n	Browse the events from our calendar to see what is happening this month at St. Elias Maronite Church.</p>\r\n', '', 0, 0),
(104, 1, 1, 'guest', 'Bulletin', 'bulletin', 'public', 1387555877, NULL, 1387555950, NULL, 13, 'bulletin', '<p>\r\n	&nbsp;&nbsp;</p>\r\n', '', 0, 0),
(105, 1, 1, 'guest', 'Scripture Readings', 'scripture-readings', 'public', 1395082538, NULL, 1396016833, NULL, 14, 'page', '<p>\r\n	We will load the scripture reading pdf&#39;s into this page.</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 0, 0);
